import React from "react";
import Book_manu from "./component/basics/BookStore";

const App = () => {
  let myStyle = {
    color: "red",
    backgroundColor: "blue",
  };
  return (
    <div style={myStyle}>
      <button>Dark Mode</button>
      <Book_manu />
    </div>
  );
};

export default App;
